// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract WorksRegistry {

    enum LicenseType { OPEN, CLOSED }

    struct Work {
        bytes32 workHash;
        LicenseType licenseType;
        address author;
        uint256 timestamp;
        string metadataJson;
    }

    struct Purchase {
        address buyer;
        uint256 timestamp;
        uint256 price;
    }

    mapping(bytes32 => Work) public works;
    mapping(bytes32 => Purchase[]) public purchases;
    mapping(address => bytes32[]) public authorWorks;
    address[] private authors;

    event WorkRegistered(bytes32 indexed workHash, address indexed author, LicenseType licenseType, string metadataJson);
    event WorkPurchased(bytes32 indexed workHash, address indexed buyer, uint256 price);

    function registerWork(bytes32 _workHash, string calldata _metadataJson, LicenseType _licenseType) external {
        require(works[_workHash].timestamp == 0, "Work already registered");

        Work storage newWork = works[_workHash];
        newWork.workHash = _workHash;
        newWork.licenseType = _licenseType;
        newWork.author = msg.sender;
        newWork.timestamp = block.timestamp;
        newWork.metadataJson = _metadataJson;

        // Add to author's works if not already there
        if (authorWorks[msg.sender].length == 0) {
            authors.push(msg.sender);
        }
        authorWorks[msg.sender].push(_workHash);

        emit WorkRegistered(_workHash, msg.sender, _licenseType, _metadataJson);
    }

    function purchaseWork(bytes32 _workHash, uint256 _price) external {
        require(works[_workHash].timestamp != 0, "Work doesn't exist");
        require(_price >= 0, "Price cannot be negative");

        Purchase memory newPurchase = Purchase({
            buyer: msg.sender,
            timestamp: block.timestamp,
            price: _price
        });

        purchases[_workHash].push(newPurchase);

        emit WorkPurchased(_workHash, msg.sender, _price);
    }

    function getWork(bytes32 _workHash) external view returns (Work memory) {
        require(works[_workHash].timestamp != 0, "Work doesn't exist");
        return works[_workHash];
    }

    function getPurchaseHistory(bytes32 _workHash) external view returns (Purchase[] memory) {
        return purchases[_workHash];
    }

    function getWorksByAuthor(address _author) external view returns (bytes32[] memory) {
        return authorWorks[_author];
    }

    // Функция для получения метаданных в формате JSON по хешу работы
    function getMetadataJson(bytes32 _workHash) external view returns (string memory) {
        require(works[_workHash].timestamp != 0, "Work doesn't exist");
        return works[_workHash].metadataJson;
    }

    // Предполагается, что следующая функция используется только владельцем платформы или для дебага
    function getAllWorks() external view returns (Work[] memory) {
        uint256 totalWorksCount = 0;
        for (uint256 i = 0; i < authors.length; i++) {
            totalWorksCount += authorWorks[authors[i]].length;
        }

        Work[] memory allWorks = new Work[](totalWorksCount);
        uint256 currentIndex = 0;

        for (uint256 i = 0; i < authors.length; i++) {
            bytes32[] memory worksByAuthor = authorWorks[authors[i]];
            for (uint256 j = 0; j < worksByAuthor.length; j++) {
                allWorks[currentIndex] = works[worksByAuthor[j]];
                currentIndex++;
            }
        }

        return allWorks;
    }
}
